'''''hísië''''' is a noun meaning "mist" in [[Quenya]].<ref>{{S|Appendix}}, ''hîth''</ref> Compare with ''[[hîth]]'' in [[Sindarin]].

==Examples==
* ''[[Hisilómë]]'' = "(Land of) Misty Night"
* ''[[Hísimë]]'' = "November"
